    for (i,j) in [(pos[0] + 1, pos[1]), (pos[0] - 1, pos[1]), (pos[0], pos[1] - 1), (pos[0], pos[1] + 1)]:
        if (len(path) == 1 or (i, j) != path[-2]) and grid[i][j] == '.':
            distMap[(i,j)] = len(path)
            path.append((i, j))
            pos = (i,j)
            break
        if grid[i][j] == 'E':
            distMap[(i,j)] = len(path)
            path.append((i, j))
            end = True


