cheats = []

for (i,j) in distMap:
    dist = distMap[(i,j)]

    for up in range (-20, 21):
        for right in range (-(20 - abs(up)), (20 - abs(up)) + 1):
            next = (i + up, j + right)

            if 0 <= next[0] < height and 0 <= next[1] < width:
                if next in distMap and distMap[next] - dist - abs(up) - abs(right) >= 100:
                    cheats.append(distMap[next] - dist - abs(up) - abs(right))

